import React from 'react'
import IFrame from 'react-iframe';

function Home() {
    return (
        <Iframe url="https://publiccloudgroup.com/"
            position="absolute"
            width="100%"
            id="myId"
            className="myClassname"
            height="100%"
            styles={{ height: "25px" }} />
    )
}

export default Home;
